    methods (Access = public)
        function J = motor_jacobian(this, joint10)
            k = this.gainK;
            
            J = zeros(this.joints, this.motors);
            J(1,1) = k(1);
            J(2,2) = k(2);
            J(3,3) = k(3);
            J(4,4) = k(4)/cos(joint10(4));
            J(5,4) = J(4,4);
            J(6,5) = k(5)/cos(joint10(6));
            J(7,5) = k(5)*sin(joint10(7))*sin(joint10(6))/(cos(joint10(7))*cos(joint10(6))*cos(joint10(6)));
            J(7,6) = k(6)/(cos(joint10(7))*cos(joint10(6)));
            J(8,5) = J(7,5);
            J(8,6) = J(7,6);
            J(9,5) = J(6,5);
            J(10,7) = k(7);
        end
        
        function joint10 = joint7to10(~, joint7)
            if size(joint7,1) ~= 7
                error("wrong input size")
            end
                        
            joint10(1:4,:) = joint7(1:4,:);
            joint10(5,:) = joint7(4,:);
            joint10(6,:) = joint7(5,:); joint10(9,:) = joint7(5,:);
            joint10(7,:) = joint7(6,:); joint10(8,:) = joint7(6,:);
            joint10(10,:) = joint7(7,:);            
        end
        
        function joint7 = joint10to7(~, joint10)
            if size(joint10,1) ~= 10
                error("wrong input size")
            end
            
            joint7(1:4,:) = joint10(1:4,:);
            joint7(5,:) = joint10(6,:);
            joint7(6,:) = joint10(7,:);
            joint7(7,:) = joint10(10,:);
        end
    end
